          artist: 'NF',
          album: 'Mansions'
        },
        {
          id: 2,
          name: 'Therapy Session',
          artist: 'NF',
          album: 'Mansions'
        },
        {
          id: 3,
          name: 'Therapy Session',
          artist: 'NF',
          album: 'Mansions'
        }
      ]
    }
  }
  render() {
    return (
      <div>
        <h1>Ja<span className="highlight">mmm</span>ing</h1>
        <div className="App">
          <SearchBar track={this.state} />
          <div className="App-playlist">
            <p> Add a SearchResults component</p>
            <Playlist playlistName={this.state.playlistName} playlistTracks={this.state.playlistTracksplaylistTracks} />
          </div>
        </div>
      </div>
    );
  }
}


export default App;
